const MAIN_URL = "http://localhost:3001/"


const PROPERTIES_URL = `${MAIN_URL}/properties`;


export const deleteProperty = (id) =>{
 return fetch(`${PROPERTIES_URL}/${id}`, {
    method: 'DELETE',
    headers: {
      'Content-type': 'application/json'
    }
  })
  .then(res => res.json())
}
